import React, { Component } from "react";
import GypsyChild from "./GypsyChild";

class GypsyParent extends Component {
  constructor(props) {
    super(props);

    this.state = {
      parentName: "Gypsy Parent Component",
    };
    this.greetParent = this.greetParent.bind(this);
  }
  greetParent() {
    alert(`Hello in parent component ${this.state.parentName}`);
  }

  render() {
    return (
      <div>
        <GypsyChild props={this.greetParent} />
      </div>
    );
  }
}

export default GypsyParent;
